-- Insert Players
INSERT INTO [dbo].[Player] ([FirstName],[LastName],[PositionId],[TeamId])
SELECT	r.[FirstName],
		r.[LastName], 
		p.Id,		
		t.Id		
FROM [dbo].[RawStats] r INNER JOIN [dbo].[Position] p on (CASE r.PositionType WHEN 'TE' THEN 'WR' ELSE r.PositionType END = p.PositionCode)-- and r.PositionType <> 'TE') OR (r.PositionType = 'WR' and r.PositionType = 'TE')
		INNER JOIN [dbo].[Team] t on r.[TeamCode] = t.TeamCode;

