-- Insert Keepers
INSERT INTO [dbo].[DraftPicks] ([LeagueYearId],[FantasyTeamId], [PlayerId], [IsKeeper])
SELECT  
		1, 
		f.Id,
		p.Id,
		1
FROM [dbo].[RawStats] r INNER JOIN [dbo].[Player] p ON r.FirstName = p.FirstName and r.LastName = p.LastName
		INNER JOIN [dbo].[Team] t ON r.TeamCode = t.TeamCode and p.TeamId = t.Id
		INNER JOIN [dbo].[FantasyTeam] f ON f.Name = r.KeeperTeam
WHERE r.KeeperTeam <> 'Free Agent';